import React from 'react';
import {Reponse} from '../components/textInput'

let str;
const Service1_1 = () => {
    return (
      <div
      style={{
        display: 'flex',  justifyContent:'center', alignItems:'center', height: '100vh',flexDirection:'column'
      }}>
        <div>
           {Reponse}
           {test()}   
      </div>
      
    </div>
    );
  };
  
  function test(){
    str={Reponse}
    String(str).substr(0, 4);
    
    console.log({str}+"test");
  }

  export default Service1_1;
